    <div className="App">
      <Router>
        <div>
          <Header />
          {/* Маршрут для страницы регистрации */}
          <Route path="/registration" component={Registration} />
          {/* Добавьте другие маршруты для других страниц */}
        </div>
      </Router>
    </div>
  );
}

export default App;
